import Overlay from "./Overlay";
import '../stylesheets/Center.css';
import '../stylesheets/ConfirmOverlay.css'
import '../stylesheets/uiButton.css'
import React from "react";

const ConfirmOverlay = ({text, onClickClose, onClickAccept, onClickCancel}) => {
    return (
        <Overlay content={
            <div className="center confirmOverlay">
                <span className="close" onClick={() => onClickClose()}>x</span>
                <h3>{text}</h3>
                <div style={{display: "flex", justifyContent: "space-evenly", marginTop: "1.5%",
                    flexDirection: "row", width: "100%"}}>
                    <button style={{width: "5em"}} className="uiButton" onClick={() => onClickAccept()}>Ja</button>
                    <button style={{width: "5em"}} className="uiButton" onClick={() => onClickCancel()}>Avbryt</button>
                </div>
            </div>
        }/>
    )
}

export default ConfirmOverlay;
